$().ready(function(){
//FUNKCJE STARTOWE
$(".sub_roots").css("display","none");
$(".sub_roots").each(function(){
if(!$(this).has("div").length) $("#"+$(this).attr("data-id")).css("display","none");
});
$(".subsub_roots").each(function(){
if(!$(this).has("div").length) $("#"+$(this).attr("data-id")).css("display","none");
});
