//ROZWIJANIE I ZWIJANIE KATEGORII
$(".category_mobile>h3").on("click", function(){
if($(".roots").css("display")==="none") $(".roots").slideDown();
else{
$(".subsubroots").css({left:"100vw"});
$(".subroots").css({marginLeft:"0px"});
$(".subroots").css({left:"100vw"});
$(".roots").slideUp(function(){$(".roots").css({"marginLeft":"0px"});})
}
});

//POKAZYWANIE PODKATEGRORII
$(document).on("click", ".root>.arrow", function(){
var back='<div class="col-xs-12 arrow_back"><span class="glyphicon glyphicon-chevron-left"></span><h5 class="main_category_up" style="margin-top: -8px; margin-left: 30px;">Powrot do kategorii</h5></div>'
$(".subroots").html(back + $('[data-id="'+$(this).attr('id')+'"]').html()).animate({left:"0vw", width:"100vw"});
$(".subsub_roots").css("display","none");
$(".roots").animate({marginLeft:"-100vw"});
});
//UKRYWANIE PODKATEGORII
$(document).on("click", ".arrow_back", function(){
$(".subroots").animate({left:"100vw",width:"0vw"});
$(".roots").animate({marginLeft:"0px"});
});
//POKAZYWANIE PODPODKATEGRORII
$(document).on("click", ".arrow_sub", function(){
var back='<div class="col-xs-12 arrow_back_2"><span class="glyphicon glyphicon-chevron-left"></span><h5 class="main_category_up" style="margin-top: -8px; margin-left: 30px;">Powrot do podkategorii</h5></div>'
$(".subsubroots").html(back + $('[data-id="'+$(this).attr('id')+'"]').html()).animate({left:"0vw", width:"100vw"});
$(".subroots").animate({marginLeft:"-100vw"});
});
//UKRYWANIE PODPODKATEGORII
$(document).on("click", ".arrow_back_2", function(){
$(".subsubroots").animate({left:"100vw",width:"0vw"});
$(".subroots").animate({marginLeft:"0px"});
});
});
